import React from "react";

function Password(props) {
  let fff="";
  if (props.value==="") {fff="page__password__body--unsuccessfully"} else {fff="page__password__body--well"}
  return (
    <div className="page__password">
        <div className="page__password__heading">
          Пароль
        </div>
        <div className="page__password__body">
          <input className={fff} type="password" name="firstPassword" value={props.value} onChange={props.onChange}/>
        </div>
    </div>
  )
}

export default Password
